VALUES ('3582810365724', 'The vert', 'GYOI(URO PREMIUM THÉ VERT / Vert éternel / Japon - Kyüshü Thé mythique parmi les plus grands ! Les feuilles brillantes vert émeraude en forme dtaiguilles très fines libèrent une infusion vert jaune lumineuse aux senteurs végétales. Véritable concentré de pureté, cette &quot;rosée précieuse&quot; à la saveur soyeuse et laiteuse, relevée par une note sucrée intense en bouche, est incontestablement le thé favori des plus fins palais. Récolte d\'exception, rare, à savou - rer.:. Ingrédient : thé vert*. *Issu de l\'agriculture biologique. GYOWRO PREMIUM GREEN TEA/Eternal green /Japan - Kyüshü Mythica/ tea... The fine emerald green needles liberate a luminous green yellow plant-scented brew. That &quot;precious dew&quot;with a silky andmilky flavour, spiced up by an intense sweet hintin the mouth, is the finest palatest favourite tea. Exceptional andrare crop, to be savoured! Ingredient: green tea*. *From organic farming.', 'https://static.openfoodfacts.org/images/products/358/281/036/5724/front_fr.4.400.jpg', '0', '0', '0', '0', '', '1', '0', '0', '', '1');

