VALUES ('3583788287360', 'Lean Bar, Red Fruits Flavour', 'Protéines de lait, chocolat au lait au maltitol (20%) (maltitol, beurre de cacao, lait entier en poudre, masse de cacao, émulsifiant : lécithine de soja, arôme naturel de vanille), fibres, oligofructose, glycerol, huile de noix de coco, édulcorants : maltitol, sucralose, glucomannane (3%), isolat de protéine de soja, eau, framboises lyophilisées (0,9%), arômes, arômes naturels, poudre de blanc d\'oeuf, acidifiant : acide citrique, colorant : carmine. Fabriqué dans un atelier utilisant : lait, oeuf, soja, gluten, arachides, fruits à coque. Comment consommer LEAN BAR : L\'effet bénéfique du glucomannane est obtenu par la consommation joumalière de 3 g de glucomannane en trois doses de 1 g chacune, prises avec 1 à 2 verres d\'eau, avant les repas et dans le cadre d\'un régime hypocalorique. Attention, les personnes soufrant de difficulté de déglutition doivent consommer Lean Bar avec beaucoup d\'eau. Une consommation excessive peut provoquer des effets laxatifs. En cas de consommation prolongée (&gt; à 2 mois), demandez conseil à un médecin ou un diététicien. Ce produit est contre-indiqué en cas d\'insuffisance rénale, hépatique, pour les femmes enceintes et les personnes de moins de 14 ans. En complément d\'une activité physique, il est important de conserver une alimentation variée et equilibrée et un mode de vie sain. Tenir hors de portée des enfants. 175 g e (5 X 35 g / r) Se conformer à la dose journalière recommandée. Conserver dans un endroit frais et sec. A consommer de preférence avant fin : Voir sur le côté.', 'https://static.openfoodfacts.org/images/products/358/378/828/7360/front_fr.4.400.jpg', '13', '9.8', '26', '4.6', '', '29', '0.18', '0.0708661417322835', '', '1');

